import React, { useState } from 'react';
import Grid from '@material-ui/core/Grid';
import Navigation from '../components/navigation'
import Checkbox from '@material-ui/core/Checkbox';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import { connect } from 'react-redux';

import '../App.css';

function MaritalStatusComponent(props){

    const [ms, setMs] = useState(props.formReducer.step1.maritalStatus);
    const msStatus = {
        1: 'Single or Married filing separately',
        2: 'Married filing jointly (or Qualifying widow(er))',
        3: 'Head of household (Check only if you’re unmarried and pay more than half the costs of keeping up a home for yourself and a qualifying individual.)'
    }

    return (
        <Grid 
        container 
        justify="center" 
        alignItems="center" 
        className="mainGrid"
        >
            <Grid item>
                <h1 className="heading">What's your Marital Status?</h1>
                <Grid 
                        container 
                        item 
                        key="single" 
                        xs={12} 
                        className="root"
                        >
                <FormControlLabel
                    control={
                    <Checkbox
                        name="checkedB"
                        color="primary"
                    />
                    }
                    label="Single or Married filing separately"
                />
                </Grid>

            </Grid>

            <Navigation prev="/step1/name" next="/" />
      </Grid>
    )

}

function mapStateToProps(state){
    return state;
}

export default connect(mapStateToProps)(MaritalStatusComponent);
